import React from 'react'
import './Home.scss'
import Sidebar from '../../components/Sidebar/Sidebar'

export default function Home() {
  return (
    <div className="Home">
        <div className="left">
            <Sidebar />
        </div>
        <div className="right">Home</div>
    </div>
  )
}
